import React from 'react';

const Hero = () => {
  return (
    <section className="min-h-screen bg-gray-100 flex items-center justify-center text-center px-4 pt-24">
      <div>
        <h1 className="text-4xl md:text-6xl font-bold">Intelligence Behind Every Financial Move</h1>
        <p className="mt-4 text-lg text-gray-700">Professional Virtual CFO services for startups & growing businesses.</p>
        <a href="#contact" className="mt-6 inline-block bg-blue-600 text-white px-6 py-3 rounded-lg">Book a Free Consultation</a>
      </div>
    </section>
  );
};

export default Hero;
